    render(){
      return(
        <div>
            <OTSession
              apiKey="47512731"
              sessionId='2_MX40NzUxMjczMX5-MTY1NTMxMzY0NTExMH5ObWhDckljbGFaOGU2VmluL0lHMXUyak5-fg'
              token=''
            >
              <OTPublisher

              />
              <OTStreams>
                <OTSubscriber
                  properties={{ width: 100, height: 100 }}
                />
              </OTStreams>
            </OTSession>
          </div>
      );
  }
}
